import React from "react";
import alternate from './images/alternate.svg';

const Cards = (props) => {
    return (
        <>
            <div className="daily_div1">
                <p className="daily_day">Today</p>
                <p className="daily_date">{props.date}</p>
                <p className="daily_temp"> &deg;c</p>
                {/* <img className="weather_icon_daily" alt="Error" src={props.item.condition.icon ? props.item.condition.icon : alternate} /> */}
            </div>
        </>
    )
}
export default Cards;
